import React from 'react'
import Head from 'next/head';

import AppLayout from '../components/AppLayout'

const Blog = ({ Component }) => {
    return(
        <>
        <Head>
            <title>EASYHO Blog</title>
            <style href="https://cdnjs.cloudflare.com/ajax/libs/antd/4.2.0/antd.min.js"></style>
        </Head>
        <AppLayout>
           <Component/>
        </AppLayout>
        </>
    )
}

export default Blog;
